import React, { Component } from 'react';
import '../Styles/How.scss';
import { Link } from 'react-router-dom';

export default class How extends Component {
  render() {
    return (
      <div>
        <Link to={'/start'}>
          <button className='home'>
            Home
          </button>  
        </Link>  
        <div>
          How
        </div>
        <div className='color'></div>
      </div>
    )
  }
}
